import {connect} from 'react-redux'
import ItemMenuGenre from './ItemMenuGenre'
import {Grid} from '@material-ui/core'
import {GetGenre} from '../../redux/actions/movie'
import axios from 'axios'

var data = [1,2,3]
class MenuGenre extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            genres : []
        }
    }
    componentDidMount(){
        axios.get('https://api.themoviedb.org/3/genre/movie/list?api_key=f2313f458f08d820fae16b7ea4c5ad70&language=en-US')
        .then((data) => {
            console.log(data)
        })
    }
    render(){
        const {activeGenre, genre} = this.props.movie
        return (
            <>
                <Grid container spacing={1}>
                    {
                        data.map(value => (
                            <Grid item key={value}><ItemMenuGenre title="tes" active={true} /></Grid>
                        ))
                    }
                </Grid>
            </>
        )
    }
}

const mapStateToProps = (state) => ({
    movie : state.movie
})

export default connect(mapStateToProps)(MenuGenre)
